import React from "react"
import './Footer.css'
import {Container,Row , Col,ListGroup,ListGroupItem} from 'reactstrap'
import { Link } from "react-router-dom"
import logo from '../../assets/images/logo.png'

const quick_link =[
    {
        path: '/home',
        display: 'Home'
    },
    {
        path: '/about',
        display: 'About'
    },
    {
        path: '/tours',
        display: 'Tours'
    }
]
const quick_link2 =[
    {
        path: '/gallery',
        display: 'Gallery'
    },
    {
        path: '/login',
        display: 'Login'
    },
    {
        path: '/register',
        display: 'Register'
    }
]




const Footer =()=>{
    return (
        <footer className="footer">
            <Container>
                <Row>
                    <Col lg='3'>

                    </Col>
                </Row>
            </Container>
        </footer>
    )
}
export default Footer;
